  [],\n\t\"revision_timestamp\": \"2016-08-04T08:17:59.723626\",\n\t\"name\": \"innoko-national-wildlife-refuge-annual-narrative-report-calendar-year-1993\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Innoko
  NWR outlines Refuge accomplishments during the 1993 calendar year. The report begins
  with a summary of the year's highlights and weather conditions. The report includes
  a planning section which discusses the master plan and management planning. Refuge
  administration is outlined; information about personnel, youth programs, volunteer
  programs, funding, safety, and technical assistance is given. Habitat management
  is also covered; subjects include wetlands, forests, and water rights. The wildlife
  section of the report discusses game mammals, fisheries resources, and marking and
  bird banding. The public uses of the Refuge described in this report include outdoor
  classrooms, interpretive programs, hunting, fishing, trapping, and law enforcement.
  The equipment and facilities section of the report provides information about new
  construction, major maintenance, equipment replacement, communication systems, and
  computer systems. Cooperative programs are provided at the end.\",\n\t\"license_title\":
